function Footer() {
  return (
    <div className='bg-[#99CAB7] opacity-40 min-h-[60vh] max-w-screen'>
        <div className='grid grid-cols-3 gap-5 space-x-5'></div>
        <div>1</div>
        <div>2</div>
        <div>3</div>
      

    </div>
  )
}

export default Footer
